            // Function to render a detailed graph
            function renderDetailedGraph(productId) {
                const data = detailedGraphs[productId];
                if (!data) {
                    console.log('No data found for product:', productId);
                    return;
                }

                const trace1 = {
                    x: data.dates,
                    y: data.PriceDiff,
                    type: 'scatter',
                    mode: 'lines+markers',
                    name: 'Price Difference',
                    yaxis: 'y1',
                    line: { color: 'red'}
                };

                const trace2 = {
                    x: data.dates,
                    y: data.StockMaxQuantity,
                    type: 'scatter',
                    mode: 'lines+markers',
                    name: 'Stock Max',
                    yaxis: 'y2',
                    line: { color: 'blue', dash: 'dot', shape: 'spline' },
                    opacity: 0.3
                };

                const trace3 = {
                    x: data.dates,
                    y: data.TotalBuys,
                    type: 'scatter',
                    mode: 'lines+markers',
                    name: 'Total Buys',
                    yaxis: 'y3',
                    line: { color: 'green', shape: 'spline'}
                };

                const trace4 = {
                    x: data.dates,
                    y: data.Rank,
                    type: 'scatter',
                    mode: 'lines+markers',
                    name: 'Rank',
                    yaxis: 'y4',
                    line: { color: 'gray', dash: 'dot', width: 2 },
                    opacity: 0.3
                };

                    title: `<a href="https://www.inet.se/produkt/${data.ProductId}" target="_blank" style="text-decoration: none; color: black;">

                    height: 600,

                        tickfont: {color: 'red'},
                        rangemode: 'tozero'

                    yaxis2: {
